classe-nice.especificacao:
Alimentos dietéticos, substâncias, bebidas e substitutos de refeições adaptados para uso médico;
alimentos para bebês e crianças, incluindo leite em pó para bebês e crianças; suplementos
dietéticos, destinados a complementar uma dieta normal ou trazer benefícios à saúde; vitaminas e
formulações vitamínicas para consumo humano; suplementos alimentares minerais; aditivos
nutricionais, suplementos e culturas.;
